INSERT INTO `eq_question` VALUES (40, '<p style=\"text-align: start;\">又是做好人好事的一天，有个小可爱私下问我有没有好用的<span style=\"color: rgb(199, 37, 78); background-color: rgb(249, 242, 244); font-size: 14px;\"><code>springboot</code></span>文件上传工具，这不巧了嘛，正好我私藏了一个好东西，顺便给小伙伴们也分享一下，<strong>demo</strong>地址放在文末了。</p><p style=\"text-align: start;\"><img src=\"https://img-blog.csdnimg.cn/img_convert/b5f798440d09af13ded31969a58f5ce6.png\" alt=\"\" data-href=\"\" style=\"height: auto;\"></p><p style=\"text-align: start;\">文件上传在平常不过的一个功能，做后端开发的基本都会接触到，虽然不难可着实有点繁琐。数据流的开闭、读取还容易出错，尤其是在对接一些<span style=\"color: rgb(199, 37, 78); background-color: rgb(249, 242, 244); font-size: 14px;\"><code>OSS</code></span>对象存储平台，一个平台一堆SDK代码看起来乱糟糟的。</p><p style=\"text-align: start;\">下边给我大家推荐一个工具<span style=\"color: rgb(199, 37, 78); background-color: rgb(249, 242, 244); font-size: 14px;\"><code>Spring File Storage</code></span>，上传文件只要些许配置<strong>一行代码</strong>搞定，开发效率杠杠的，一起看看是不是有这么流批！</p>', '0', '<p><br></p>', 2, 5, '0', 9, NULL, 10, '2022-11-10 15:20:53', '2022-11-10 15:20:53');
INSERT INTO `eq_question` VALUES (41, '<p><span style=\"color: rgb(33, 37, 41); background-color: rgb(255, 255, 255); font-size: 14px;\">车的行驶，轮船的航行，飞机的飞行等这类物体位置发生变化的运动叫做（ ）</span></p>', '1', '<p><br></p>', 2, 5, '0', 9, NULL, 10, '2022-11-10 15:25:16', '2022-11-10 15:25:16');
INSERT INTO `eq_question` VALUES (42, '<p><span style=\"color: rgb(33, 37, 41); background-color: rgb(255, 255, 255); font-size: 14px;\">2012年国际田联110m栏比赛中，刘翔以12秒97破赛会记录夺得冠军．如图所示是刘翔在跨栏时的情景，若说赛场的主席台是运动的，所选的参照物是：<br></span></p><p><img src=\"https://tikuimgs.oss-cn-qingdao.aliyuncs.com/tikuimg/q_500012/a/04/04/c0989ae94a.png\" alt=\"\" data-href=\"\" style=\"width: 216px;height: 125px;\"/></p>', '0', '<p><br></p>', 2, 5, '0', 9, NULL, 10, '2022-11-10 15:25:59', '2022-11-10 15:25:59');
INSERT INTO `eq_question` VALUES (43, '<p><span style=\"color: rgb(33, 37, 41); background-color: rgb(255, 255, 255); font-size: 14px;\">中国是掌握空中加油技术的少数国家之一．如图是我国自行研制的第三代战斗机“歼 一 10”在空中加油的情景，以下列哪个物体为参照物，可认为加油机是静止的<br></span></p><p><img src=\"https://tikuimgs.oss-cn-qingdao.aliyuncs.com/tikuimg/q_500012/a/04/04/6d75076306.png\" alt=\"\" data-href=\"\" style=\"width: 134px;height: 85px;\"/></p><p><img src=\"https://tikuimgs.oss-cn-qingdao.aliyuncs.com/tikuimg/q_500012/a/04/04/c0989ae94a.png\" alt=\"\" data-href=\"\" style=\"width: 216px;height: 125px;\"/></p>', '0', '<p><br></p>', 2, 5, '0', 9, NULL, 10, '2022-11-10 15:26:13', '2022-11-10 15:26:13');
INSERT INTO `eq_question` VALUES (44, '<h1 style=\"text-indent: 2em; text-align: left;\">某公司总部与各分支机构之间需要传输大量的数据，并要求在保障数据安全的同时又要兼顾密钥算法效率。针对该用户需求，设计师最可能选用的加密算法是(41)。 </h1>', '1', '<p><br></p>', 2, 5, '0', 9, NULL, 10, '2022-11-10 15:30:01', '2022-11-10 15:30:01');
