INSERT INTO `eq_question` VALUES (589, '编制串行口方式 3 的全双工通信程序，设双机将各自键盘的按键键值发送给对方，接收正确后放入缓冲区，晶振\n为 11.0592MHz，波特率为 9600bps，第 9 个数据位作为奇偶检验位。\n#include&lt;reg51.h&gt;\n#define uchar unsigned char\nchar k,keynum,temp;\nuchar buffer;\nuchar code table[]= {0xc0,0xf9,0xa4,0xb0,0x99,0x92,0x82,0xf8,0x80,0x90,0x88,0x83,0xc6,0xa1,0x86,0x8e};\nuchar keyscan();\nvoid display(uchar d);\nvoid delayms(int x)\n{\nint i,j;\nfor(i=0;i&lt;x;i++)\nfor(j=0;j&lt;120;j++);\n}\nvoid main()\n{\nSCON= ;\nTMOD= ;\nTH1=0xFD;\nTL1=0xFD;\n;\n;\n;\n//以上为中断初始化\nwhile(1)\n{\nk=keyscan();\nif(k!=-1)\n{\nACC=k;\nTB8=P;\nSBUF= ;\n}\ndisplay(buffer);\n}\n}\nvoid serial_server() interrupt 4\n{\nif( )\n{\nTI=0;\n}\nelse\n{\nRI=0;\nACC= ;\nif(RB8==P)\nbuffer=ACC;\n}\n}\nuchar keyscan()\n{\nif(P1!=0xff)\n{\ndelayms(10);\nif(P1!=0xff)\n{\ntemp=P1;\nwhile(P1!=0xff);\nswitch(temp)\n{\ncase 0xfe:return 1;break;\ncase 0xfd:return 2;break;\ncase 0xfb:return 3;break;\ncase 0xf7:return 4;break;\ncase 0xef:return 5;break;\ncase 0xdf:return 6;break;\ncase 0xbf:return 7;break;\ncase 0x7f:return 8;break;\ndefault:return 0;break;\n}\n}\n}\nreturn -1;\n}\nvoid display(uchar d)\n{\nif(d!=-1)\n{\nP2= ;\n}\n}\n', '3', NULL, 2, 5, '0', 9, NULL, 10, '2022-11-12 18:43:13', '2022-11-12 18:43:13');
INSERT INTO `eq_question` VALUES (590, '\n利用实验板和配件，设计一个时钟，时间显示在数码管上，并按秒更新，能够通过按键调整时，分，秒。选用定时\n器 T0,每 2ms 进一次中断，其功能为：功能选择键，数值增大和数值减小键。\nC51 源程序如下:\n#include&lt;reg52.h&gt;\n#define KeyPort P1 //定义按键端口\n#define DataPort P0 //定义数据端口 程序中遇到 DataPort 则用 P0 替换\nsbit duan=P2^2;//定义锁存使能端口 段锁存\nsbit wei=P2^1;// 位锁存\nunsigned char hour,minute,second;//定义时分秒\nbit UpdateTimeFlag;//定义读时间标志\nunsigned char code DuanMa[10]={0x3f,0x06,0x5b,0x4f,0x66,0x6d,0x7d,0x07,0x7f,0x6f};// 显示段码值 0~9\nunsigned char code WeiMa[]={0xfe,0xfd,0xfb,0xf7,0xef,0xdf,0xbf,0x7f};//分别对应相应的数码管点亮,即位码\nunsigned char TempData[8]; //存储显示值的全局变量\nvoid DelayUs2x(unsigned char t);//us 级延时函数声明\nvoid DelayMs(unsigned char t); //ms 级延时\nvoid Display(unsigned char weino,unsigned char Num);//数码管显示函数\nunsigned char KeyScan(void);//键盘扫描\nvoid Init_Timer0(void);//定时器初始化\nvoid main (void)\n{\nunsigned char num;\nInit_Timer0();\nwhile (1) //主循环\n{\nnum= ;\nswitch(num)\n{case 1:hour++;if(hour==24)hour=0;\nbreak;\ncase 2:hour--;if(hour==255)hour=23;\nbreak;\ncase 3:minute++;if(minute==60)minute=0;\nbreak;\ncase 4:minute--;if(minute==255)minute=59;\nbreak;\ndefault:break;\n}\nif(UpdateTimeFlag==1)\n{\nUpdateTimeFlag=0;\nTempData[0]=DuanMa[hour/10];\nTempData[1]=DuanMa[hour%10];\nTempData[2]=0x40;\nTempData[3]=DuanMa[minute/10];\nTempData[4]=DuanMa[minute%10];\nTempData[5]=0x40;\nTempData[6]=DuanMa[second/10];\nTempData[7]=DuanMa[second%10];\n}\n}\n}\nvoid DelayUs2x(unsigned char t)\n{\nwhile(--t);\n}\nvoid DelayMs(unsigned char t)\n{\nwhile(t--)\n{\n//大致延时 1mS\nDelayUs2x(245);\nDelayUs2x(245);\n}\n}\nvoid Display(unsigned char weino,unsigned char Num)\n{\nstatic unsigned char i=0;\nDataPort=0;\nduan=1;\nduan=0;\nDataPort=WeiMa[i+weino];\nwei=1;\nwei=0;\nDataPort=TempData[i];\nduan=1;\nduan=0;\ni++;\nif(i==Num)\ni=0;\n}\nvoid Init_Timer0(void)\n{\nTMOD |= 0x01; //使用模式 1，16 位定时器，使用\"|\"符号可以在使用多个定时器时不受影响\nEA=1; //总中断打开\n; //定时器中断打开\n; //定时器开关打开\n}\nvoid Timer0_isr(void) interrupt 1\n{\nstatic unsigned int num,i;\nTH0= ;//重新赋值 2ms\nTL0= ;\nDisplay(0,8); // 调用数码管扫描\ni++;\nif(i==10) //20ms 更新一次\n{\ni=0;\nUpdateTimeFlag=1; //更新时间志位置 1\n}\nnum++;\nif(num==500) //大致 1s\n{\nnum=0;\nsecond++;\nif( )\n{\nsecond=0;\nminute++;\nif( )\n{\nminute=0;\nhour++;\nif()//小时到 24，回零\nhour=0;\n}\n}\n}\n}\nunsigned char KeyScan(void)\n{\nunsigned char keyvalue;\nif(KeyPort!=0xff)\n{\n;\nif(KeyPort!=0xff)\n{\nkeyvalue=KeyPort;\nwhile(KeyPort!=0xff);\nswitch( )\n{\ncase 0xfe:return 1;break;\ncase 0xfd:return 2;break;\ncase 0xfb:return 3;break;\ncase 0xf7:return 4;break;\ncase 0xef:return 5;break;\ncase 0xdf:return 6;break;\ncase 0xbf:return 7;break;\ncase 0x7f:return 8;break;\ndefault:return 0;break;\n}\n}\n}\nreturn 0;\n}\n', '3', NULL, 2, 5, '0', 9, NULL, 10, '2022-11-12 18:43:13', '2022-11-12 18:43:13');
