INSERT INTO `eq_question` VALUES (1159, '在整个维护阶段所花费的全部工作量中，（ ）占的比例最高。\nA．预防性维护&nbsp;\nB．适应性维护&nbsp;\nC．完善性维护\nD．改正性维护\n', '4', NULL, 2, 5, '0', 6, 10, 10, '2023-02-28 10:08:31', '2023-02-28 10:08:31');
INSERT INTO `eq_question` VALUES (1160, '面向对象的测试与传统测试方法的主要区别是( )。\nA．面向对象的测试可在编码前进行，传统测试在编码后进行\nB．面向对象的测试以需求和设计阶段的测试为主，不需要进行代码测试\nC．测试对象不同\nD．面向对象的测试不需要设计测试用例，只需要进行会议评审\n', '4', NULL, 2, 5, '0', 6, 10, 10, '2023-02-28 10:08:31', '2023-02-28 10:08:31');
INSERT INTO `eq_question` VALUES (1161, '在软件的使用过程中，用户发现错误并将这些问题报告给维护人员。对这类错误的诊断和改正的过程称\n之为（）。', '0', NULL, 2, 5, '0', 6, 10, 10, '2023-02-28 10:08:31', '2023-02-28 10:08:31');
INSERT INTO `eq_question` VALUES (1162, '（）是保证软件质量和可靠性的重要手段，其主要方式是在设计测试用例的基础上检测软件的各个组成\n部分。\nA．总体设计\nB．详细设计\nC．编码\nD．测试\n', '4', NULL, 2, 5, '0', 6, 10, 10, '2023-02-28 10:08:31', '2023-02-28 10:08:31');
INSERT INTO `eq_question` VALUES (1163, ' （）又称模块测试，主要是为了发现模块内部可能存在的各种错误和不足。\nA．单元测试\nB．集成测试\nC．有效性测试\nD．验收测试\n', '4', NULL, 2, 5, '0', 6, 10, 10, '2023-02-28 10:08:31', '2023-02-28 10:08:31');
INSERT INTO `eq_question_item` VALUES (115, '<p>Spring File Storage<span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\">工具几乎整合了市面上所有的OSS对象存储平台，包括</span>本地<span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\">、</span>FTP<span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\">、</span>SFTP<span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\">、</span>WebDAV<span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\">、</span>阿里云OSS</p>', NULL, 40, '2022-11-10 15:20:53', '2022-11-10 15:20:53');
INSERT INTO `eq_question_item` VALUES (116, '<p>华为云OBS<span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\">、</span>七牛云Kodo<span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\">、</span>腾讯云COS<span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\">、</span>百度云 BOS<span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\">、</span>又拍云USS<span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\">、</span>MinIO<span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\">、</span>京东云 OSS<span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\">、</span>网易数帆 NOS<span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\">等其它兼容 S3 协议的平台，</span></p>', '1', 40, '2022-11-10 15:20:53', '2022-11-10 15:20:53');
INSERT INTO `eq_question_item` VALUES (117, '<p><span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\">下边以本地和Aliyun OSS上传为例，</span>pom.xml<span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\">中引入必要的</span>spring-file-storage.jar<span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\">，</span><span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\"><strong>注意：</strong></span><span style=\"color: rgb(77, 77, 77); background-color: rgb(255, 255, 255); font-size: 16px;\"> 如果要上传文件到OSS平台，需要引入对应平台的SDK包。</span></p>', NULL, 40, '2022-11-10 15:20:53', '2022-11-10 15:20:53');
INSERT INTO `eq_question_item` VALUES (118, '<p><span style=\"color: rgb(0, 0, 0); font-size: 14px;\">&lt;!-- spring-file-storage 必须要引入 --&gt;</span><span style=\"color: rgb(0, 0, 0); background-color: rgb(243, 244, 245); font-size: 14px;\"> </span><span style=\"color: rgb(0, 0, 0); font-size: 14px;\">&lt;dependency&gt;</span><span style=\"color: rgb(0, 0, 0); background-color: rgb(243, 244, 245); font-size: 14px;\"> </span><span style=\"color: rgb(0, 0, 0); font-size: 14px;\">&lt;groupId&gt;</span><span style=\"color: rgb(0, 0, 0); background-color: rgb(243, 244, 245); font-size: 14px;\">cn.xuyanwu</span><span style=\"color: rgb(0, 0, 0); font-size: 14px;\">&lt;/groupId&gt;</span><span style=\"color: rgb(0, 0, 0); background-color: rgb(243, 244, 245); font-size: 14px;\"> </span><span style=\"color: rgb(0, 0, 0); font-size: 14px;\">&lt;artifactId&gt;</span><span style=\"color: rgb(0, 0, 0); background-color: rgb(243, 244, 245); font-size: 14px;\">spring-file-storage</span><span style=\"color: rgb(0, 0, 0); font-size: 14px;\">&lt;/artifactId&gt;</span><span style=\"color: rgb(0, 0, 0); background-color: rgb(243, 244, 245); font-size: 14px;\"> </span><span style=\"color: rgb(0, 0, 0); font-size: 14px;\">&lt;version&gt;</span><span style=\"color: rgb(0, 0, 0); background-color: rgb(243, 244, 245); font-size: 14px;\">0.5.0</span><span style=\"color: rgb(0, 0, 0); font-size: 14px;\">&lt;/version&gt;</span><span style=\"color: rgb(0, 0, 0); background-color: rgb(243, 244, 245); font-size: 14px;\"> </span><span style=\"color: rgb(0, 0, 0); font-size: 14px;\">&lt;/dependency&gt;</span></p>', NULL, 40, '2022-11-10 15:20:53', '2022-11-10 15:20:53');
