INSERT INTO `eq_question_item` VALUES (1478, NULL, '时钟周期即振荡周期：为晶振的振荡周期，是最小的时序单位。状态周期：是振荡频率 2 分频后的时钟周期。显然一\n个状态周期包含两个振荡周期。机器周期：一个机器周期由 6 个状态周期，即 12 个振荡周期组成，是度量指令执行时\n间的单位。指令周期：是执行一条指令所需要的时间。一个指令周期由 1~4 个机器周期组成。', 573, '2022-11-12 18:43:13', '2022-11-12 18:43:13');
