INSERT INTO `eq_question_item` VALUES (2352, NULL, '正确\n三、填空题\n&nbsp;是指在计算机软件开发、使用与维护过程中遇到的一系列严重问题和难题。\n答案：软件危机\n&nbsp;指在定义、开发、使用和维护软件时，要实施的过程、活动和任务。\n答案：软件工程过程\n根据软件服务对象的不同，软件可以分为通用软件和 。\n答案：定制软件\n软件工程的根基是对 的关注。\n答案：质量\n&nbsp;是将软件生存周期各个活动规定为依线性顺序连接的若干阶段的模型。\n答案：瀑布模型\n&nbsp;是一种用于风险较大的大型软件项目开发的过程模型。\n答案：螺旋模型\n&nbsp;是软件生存周期中时间最长的阶段。\n答案：维护阶段\n软件生存周期是指一个软件从 开始直到该软件最终退役为止的整个时期。\n答案：定义\n需求分析的主要任务是 。\n答案：要回答&ldquo;软件必须做什么?&rdquo;\n________________ 阶段是为每个模块完成的功能进行具体的描述，要把功能描述转变为精确的、结构化的过程描述。\n答案：详细设计\n在结构化分析方法中，用以表达系统内数据的运动情况的工具是________________。\n答案：数据流图\n结构化分析方法(SA)是一种面向________________的需求分析方法。\n答案：数据流\n需求分析最终结果是产生________________文档。\n答案：需求规格说明书\n数据流图中的箭头表示________________。\n答案：数据流\n数据流图一般可分为_______________和事务型两类。\n答案：变换型\n_______________是描述软件使用或产生的所有数据对象，是结构化分析模型的核心。\n答案：数据字典\n模块之间联系越紧密，其_______________就越强，模块的____________则越差。\n答案：耦合性，内聚性\n数据耦合传递的是_______________,控制耦合传递的是_______________ 。\n答案：数据值，控制变量\n_____________指一个模块内的各处理元素之间没有任何联系。\n答案：偶然内聚\n_____________指一个模块内的各组成部分都为同一个功能而存在，只完成单一的功能。\n答案：功能内聚\nJackson 设计方法是由英国的 M．Jackson 所提出的。它是一种面向________________的软件设\n计方法。\n答案：数据结构\n当数据流图中的某个加工的一组动作存在着多个条件复杂组合的判断时，其加工逻辑使用________________\n答案：判定表或判定树\n在 UML 中________________图从用户的角度描述系统的功能，________________图描述系统的结构，展示系统中类的静态\n结构。\n答案：用例，类\n在 UML 中________________图根据系统的代码构件显示系统代码的物理结构，________________图用于显示系统中硬件和\n软件的物理结构。\n答案：构件，部署\n在 UML 中________________图描述对象的一组交互方式，它表示完成某项行为的对象和这些对象之间传递消息的时间顺序。\n答案：顺序\n在 UML 中________________图可以根据活动发生位置的不同划分为若干个矩形区，每个矩形区称为一个泳道。\n答案：活动\n面向对象模型中 模型用于描述系统数据结构。\n答案：对象\n面向对象模型中 模型用于描述系统的执行操作。\n答案：动态\n在状态图中，_______________是引起对象状态转换的控制信息，是在某个特定时刻所发生的事情。\n答案：事件\n在建立对象模型时，定义_____________是需要等到建立动态模型和功能模型之后。\n答案：服务\n大多数系统的面向对象设计模型，在逻辑上都由_______________、人机交互、任务管理、和数据管理 4 大子系统组成。\n答案：问题域\n人机交互子系统中，当系统中存在 3 个以上的任务是，就应该增加一个_____________。\n答案：协调任务\n_____________是指源程序的书写习惯，比如变量的命名规则、代码的注释方法、缩进等。\n答案：编程风格\n成功的测试是指运行测试用例后_______________。\n答案：发现了目前为止未发现的错误\n_______________测试是不实际运行被测软件，而是直接分析软件的形式和结构，查找缺陷。\n答案：静态\n软件测试用例主要由输入数据和预期的_______________两部分组成。\n答案：输出结果\n软件测试中白盒法是通过分析程序的________________来设计测试用例的。\n答案：内部逻辑\n_______________指设计足够测试用例，使判定表达式中每个条件的各种可能的值至少出现一次。\n答案：条件覆盖\n_______________指设计足够的测试用例，使得每个判定表达式中条件的各种可能的值的组合都至少出现一次。\n答案：条件组合覆盖\n基本路径测试是在程序 基础上，通过分析控制构造的 复杂性，导出 集合，从而设计测试用例。\n答案：控制流程图，环路， 基本路径\n在测试程序时，根据经验或直觉推测程序中可能存在的各种错误，称为 。\n答案：错误推测法\n&nbsp;测试指对源程序中每一个程序单元进行测试，检查各个模块是否正确实现规定的功能，从而发现模块在编码中或算法中\n的错误。\n答案：单元\n确认测试在模拟环境下运用 测试方法\n答案：黑盒\n用等价类划分法设计一个测试用例时，使其覆盖 尚未被覆盖的合理等价类。\n答案：尽可能多的\n用等价类划分法设计一个测试用例时，使其覆盖 不合理等价类。\n答案：一个\n在单元测试时，需要为被测模块设计 。\n答案：驱动模块与桩模块\n动态测试中，主要测试软件功能的方法称为 法。\n答案：黑盒法\n选择测试用例，使得被测程序中每个判定的每个分支至少执行一次，这种逻辑覆盖标准称为 。\n答案：判定覆盖\n用等价类划分法设计测试用例时，如果被测程序的某个输入条件规定了取值范围，则可确定一个有效的等价类和 。\n答案：两个无效的等价类\n四、多项选择题\n由于软件生产的复杂性和高成本性，使大型软件的生存出现危机，软件危机的主要表现包括了下述（ ）方\n面。\nA.生产成本过高\nB.需求增长难以满足\nC.进度难以控制\nD.质量难以保证\n答案： ABCD\n产生软件危机的原因主要与两个方面的问题有关是（）\nA.软件在计算机中很难识别，存在磁盘中也看不到。\nB.软件产品本身的特点与其它工业产品不一样\nC.在软件的开发和维护过程中用的方法不正确。\nD.软件设计对人的智商要求很高，也要求很高的资金投入。\n答案： BC\n基于功能的不同，软件可以分为（）\nA.系统软件\nB.通用软件\nC.支撑软件\nD.应用软件\nE.定制软件\n答案： ACD\n常见的软件生命周期模型包括（ ）\nA.瀑布模型\nB.快速原型模型\nC.喷泉模型\nD.增量模型\nE.螺旋模型\n答案： ABCDE\n关于敏捷模型的价值观描述正确的有（）\nA. 个体与交互高于过程和工具\nB. 可运行软件高于详尽的文档\nC. 与客户协作高于合同（契约）谈判\nD. 对变更及时响应高于遵循计划\nE. 文档可有可无、无需制定详细的计划\n答案： ABCD\n可行性研究的任务包括下列哪些项（ ）任务。\nA．技术可行性\nB．经济可行性&nbsp;\nC．资源可行性\nD．操作可行性\n答案： ABD\n结构化分析（SA）的步骤包括：\nA.建立当前系统物理模型\nB.建立当前系统逻辑模型\nC.建立目标系统逻辑模型\nD.建立目标系统物理模型\n答案： ABC\n需求获取的方法有（）\nA.访谈\nB.问卷调查\nC.建立原型\nD.实地操作\n答案： ABCD\n描述结构化系统分析方法的工具有( )\nA．数据流图&nbsp;\nB．组织结构图\nC．数据词典&nbsp;\nD．E_R 图\n答案:ACD\n数据流图的基本成分有（ ）。\nA.信息源\nB.加工\nC.数据存储\nD.数据流\nE.控制流\n答案： ABCD\nE_R 图的基本成分有（ ）\nA.实体\nB.数据\nC.属性\nD.关系\nE.控制\n答案： ACD\n在软件的开发过程中，必须遵循的原则是（）。\nA.抽象&nbsp;\nB.模块化&nbsp;\nC.可重用性\nD.可维护性\n答案： ABCD\n下列耦合中属于低偶合是（ ）。\nA.内容偶合\nB.公共偶合\nC.数据耦合\nD.非直接偶合\n答案：CD\n下列内聚属于高内聚的是（）\nA.偶然内聚\nB.功能内聚\nC.逻辑内聚\nD.顺序内聚\n答案：BD\n结构化程序流程图中一般包括三种基本结构，下述结构中( )哪些属于其基本结构。\nA．条件结构\nB．选择结构&nbsp;\nC．循环结构\nD．顺序结构&nbsp;\n答案： BCD\n以下属于结构化概要设计的工具的是（）\nA.层次图\nB.PAD 图\nC.HIPO 图\nD.结构图\n答案： ACD\n下列是详细设计工具的是( )。\nA.N-S 图\nB.判定表\nC.PAD 图\nD.数据流图\n答案： ABC\n下面关于过程设计语言（PDL）描述正确的是。\nA.与高级程序设计语言非常类似，只要对 PDL 描述稍加变换就可变成源程序代码。\nB.形象直观\nC.同自然语言很接近，易于理解\nD.既可很抽象，又可以很具体\n答案： ACD\n下面关于程序流程图描述正确的是( )。\nA.它使程序员容易过早地考虑程序的具体控制流程，而忽略了程序的全局结构\nB.使用箭头代表控制流，这样使得程序员不受任何约束，可以完全不顾结构程序设计地精神，随意转移控\n制\nC.很容易表现嵌套关系，也可以表示模块的层次结构\nD.比较直观，易于学习掌握\n答案： ABD\n可以用来表示的条件组合与应做的动作之间的对应关系的工具有（）\nA.PAD 图\nB.判定树\nC.程序流程图\nD.判定表\n答案： BD\n下列属于 UML 静态建模机制的图形有（）。\nA.用例图\nB.类图\nC.顺序图\nD.活动图\n答案： AB\n下列属于 UML 动态建模机制的图形有（）。\nA.对象图\nB.状态图\nC.顺序图\nD.活动图\n答案： BCD\n用例图中用例与用例的关系有（）\nA.包含关系&nbsp;\nB.封装关系\nC.扩展关系&nbsp;\nD.泛化关系\n答案： ACD\n顺序图有（）等元素组成。\nA.对象&nbsp;\nB.生命线\nC.控制焦点&nbsp;\nD.消息\nE.状态\n答案： ABCD\n类与类之间的关系有（）\nA.关联&nbsp;\nB.依赖\nC.实现&nbsp;\nD.泛化\n答案： ABCD\n在 UML 中，用于描述物理架构的图有（）\nA.用例图&nbsp;\nB.类图\nC.构件图\nD.部署图\n答案： CD\n选择程序设计语言的时候要考虑的因素有（）\nA.系统的应用领域\nB.软件执行环境\nC.用户要求\nD.程序编写人员目前具备的知识\n答案： ABCD\n下列关于软件测试的基本原则描述正确的是。\nA、尽早地，不断地进行软件测试\nB、设计测试用例时，要给出测试的预期结\nC、软件产品中所存在的错误数与已经发现的错误数成反比\nD、开发小组和测试小组分开\n答案： ABD\n下列哪些属于静态测试方法（）\nA.审查&nbsp;\nB.走查\nC.等价类划分&nbsp;\nD.语句覆盖\n答案： AB\n下列测试方法属于黑盒测试的是( )。\nA.等价类划分\nB.边值分析\nC.因果图\nD.语句测试\n答案： ABC\n下列属于白盒测试技术的是（ ）。\nA.语句覆盖\nB.基本路径测试\nC.边界值分析\nD.判定覆盖\n答案： ABD\n软件测试的步骤包括( )。\nA.单元测试\nB.集成测试\nC.系统测试\nD.验收测试\n答案： ABCD\n单元测试一般需要以下哪两个模块作为辅助（）\nA.驱动模块\nB.用例模块\nC.桩模块\nD.测试模块\n答案： AC\n根据各模块的组装方式不同集成测试可分为（）\nA.白盒测试\nB.非渐增式测试\nC.渐增式测试\nD.黑盒测试\n答案： BC\n软件维护的类型有哪些（）\nA.纠错维护\nB.适应性维护\nC.完善性维护\nD.预防性维护\n答案： ABCD', 923, '2022-11-18 18:26:26', '2022-11-18 18:26:26');
